import React, { useContext } from 'react'
import { PostProviderContext } from '../context/PostProvider'
import { Post } from "./Post"

export const Feed = () => {

    const { posts } = useContext(PostProviderContext)

    return (
        <div>

            <Post posts={posts} />
        </div>
    )
}
